Saya sebagai petani kopi insyaallah banyak tahu soal Baik buruk pupuk organik dan kimia ..dari kebiasaan dan riset saya sendiri melalui pengalaman tangan saya sendiri kesimpulannya dari saya ; 
1. Organik bersifat lama bereaksi tuk Tanaman walaw kelengkapan unsur nya tidak selengkap kimia makanya perlu perlakuan rutin dalam pemakaian organik namun perlu kita pahami organik melahirkan kan mikroorganisme baik ,bakteri penyubur tanaman dan kesuburan lahan jangka panjang bahkan di kopi saya praktek kan pertumbuhan daun batang hingga berbuah sangat melimpah lebih baik dan hijau ya 
2.kimia memiliki reaksi lebih cepat tapi lahan cepat rusak ,mikroorganisme dan ekosistem dan lingkungan rusak bahkan kerusakan tanah jangka panjang meski pupuk kimia mudah didapat dan unsur sintetis lengkap resiko nya besar lahan akan kurang subur dan mesti harus rajin mengolah tanah
